import React from "react";

export default function RecipeCard(props) {
  const diets = props.Diets.map((diet) => diet.name);
  return (
    <div>
      <img src={props.image} alt="recipe" />
      <div>
        <p>{props.id} </p>
        <p>Name: {props.name}</p>
        <h3>Diets</h3>
        {diets.map((d) => (
          <li key={props.id}>{d}</li>
        ))}
      </div>
    </div>
  );
}
